Chandramohan (Dileep) works at Thiruvananthapuram Secretariat in
the Petition Committee. His wife Sushama (Anusree) is a BSNL employee.
Sushama loves her husband so much that Chandramohan is almost sick with
her love and concern for him. It is at this time that Sushama gets a transfer
to Thrissur. While Sushama is so worried with the thoughts of her husband,
Chandramohan enjoys a bachelor life in Thiruvananthapuram. Namitha
Pramod does the role of the girl who comes with the petition.

